import React from 'react';
import './App.css';
import SmallText from './components/SmallText.js';
import TextButton from './components/TextButton.js';
import DspButton from './components/DspButton.js';
import SwitchButton from './components/SwitchButton.js';
import NumberInput from './components/NumberInput.js';
import TabGroup from './components/ButtonGroup.js';

class SpacingPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            streamNumber: null,
            role: null,
            recordDeal: [],
            publishDeal: [],
            sliderValue: null,
            recordDealSelected: null,
            publishingDealSelected: null,
            advance: null
        };

    }

    render() {
      return (
        <div style={{display: 'flex', flexDirection: 'row'}}>
            <div style={{width: 'auto', flexDirection: 'colum', backgroundColor:'black'}}>
              <SmallText text="Your Role" style={{ fontSize: '24px', fontWeight: 'bold', lineHeight: '1.09', textAlign: 'center', color: '#323747' }}/>
              <TabGroup/>
            </div>
            <div style={{width: 'auto', flexDirection: 'colum', backgroundColor:'grey'}}>
              <SmallText text="top middle" style={{backgroundColor: 'Red'}}/>
              <SmallText text="middle middle" style={{backgroundColor: 'aqua'}}/>
              <SmallText text="bottom middle" style={{backgroundColor: 'green'}}/>
            </div>
            <div style={{width: 'auto', flexDirection: 'colum', backgroundColor:'brown'}}>
              <SmallText text="top right" style={{backgroundColor: 'Orange'}}/>
              <SmallText text="middle right" style={{backgroundColor: 'salmon'}}/>
            </div>
        </div>
        )
    }
  }

  export default SpacingPage;
